class AdsModel {  int? id;  String? title;  int? frequency;  int? order;  String? startDate;  String? endDate;  int? view;  int? click;  int? status;  String? createdAt;  String? updatedAt;  String? deletedAt;  int? clickCount;  int? viewCount;  List<Section>? section;  AdsModel(      {this.id,        this.title,        this.frequency,        this.order,        this.startDate,        this.endDate,        this.view,        this.click,        this.status,        this.createdAt,        this.updatedAt,        this.deletedAt,        this.clickCount,        this.viewCount,        this.section});  AdsModel.fromJson(Map<String, dynamic> json) {    id = json['id'];    title = json['title'];    frequency = json['frequency'];    order = json['order'];    startDate = json['start_date'];    endDate = json['end_date'];    view = json['view'];    click = json['click'];    status = json['status'];    createdAt = json['created_at'];    updatedAt = json['updated_at'];    deletedAt = json['deleted_at'];    clickCount = json['click_count'];    viewCount = json['view_count'];    if (json['section'] != null) {      section = <Section>[];      json['section'].forEach((v) {        section!.add(new Section.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this.id;    data['title'] = this.title;    data['frequency'] = this.frequency;    data['order'] = this.order;    data['start_date'] = this.startDate;    data['end_date'] = this.endDate;    data['view'] = this.view;    data['click'] = this.click;    data['status'] = this.status;    data['created_at'] = this.createdAt;    data['updated_at'] = this.updatedAt;    data['deleted_at'] = this.deletedAt;    data['click_count'] = this.clickCount;    data['view_count'] = this.viewCount;    if (this.section != null) {      data['section'] = this.section!.map((v) => v.toJson()).toList();    }    return data;  }}class Section {  int? id;  int? adID;  int? imgOrder;  String? originalName;  String? storedName;  String? location;  String? extension;  String? size;  String? redirectUrl;  String? createdAt;  String? updatedAt;  String? status;  Section(      {this.id,        this.adID,        this.imgOrder,        this.originalName,        this.storedName,        this.location,        this.extension,        this.size,        this.redirectUrl,        this.createdAt,        this.updatedAt,        this.status});  Section.fromJson(Map<String, dynamic> json) {    id = json['id'];    adID = json['adID'];    imgOrder = json['img_order'];    originalName = json['original_name'];    storedName = json['stored_name'];    location = json['location'];    extension = json['extension'];    size = json['size'];    redirectUrl = json['redirectUrl'];    createdAt = json['created_at'];    updatedAt = json['updated_at'];    status = json['status'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this.id;    data['adID'] = this.adID;    data['img_order'] = this.imgOrder;    data['original_name'] = this.originalName;    data['stored_name'] = this.storedName;    data['location'] = this.location;    data['extension'] = this.extension;    data['size'] = this.size;    data['redirectUrl'] = this.redirectUrl;    data['created_at'] = this.createdAt;    data['updated_at'] = this.updatedAt;    data['status'] = this.status;    return data;  }}